import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class Contact extends Component {
    render() {
        return (
            <div className="contact-body">
            <Grid className="contact-grid">
            <Cell col={6}>
                <h2>Crystyano Almeida</h2>
                <img
                    src="https://cdn0.iconfinder.com/data/icons/avatar-78/128/12-512.png"
                    alt="avatar"
                    style={{height: '250px'}}
                />
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec ultricies ligula 
                    nec quam posuere, et ultrices enim ultricies. Interdum et malesuada fames ac 
                    ante ipsum primis in faucibus.</p>
            </Cell>
            <Cell col={6}>Half page</Cell>

            </Grid>

            </div>
        );
    }
}

export default Contact;
